const MarqueeSkills: React.FC = () => {
    const { theme } = useTheme();
    const duplicatedSkills = [...skills, ...skills, ...skills, ...skills]; // for infinite loop
    const EvenSkills = skills.filter((_, index) => index % 2 === 0);
    const getEvenSkills = [...EvenSkills, ...EvenSkills, ...EvenSkills, ...EvenSkills]; // for infinite loop
    return (
        <div className="relative w-full overflow-hidden flex flex-col gap-4 group ">

            <div className={`pointer-events-none absolute left-0 top-0 h-full w-20 bg-gradient-to-r ${theme == 'dark' ? "from-black" : "from-white"}  to-transparent z-10`} />
            <div className={`pointer-events-none absolute right-0 top-0 h-full w-20 bg-gradient-to-l ${theme == 'dark' ? "from-black" : "from-white"} to-transparent z-10`} />

            {/* first: right to left */}
            <div
                className="flex w-max animate-[marquee_100s_linear_infinite] whitespace-nowrap hover:[animation-play-state:paused]"
            >
                {duplicatedSkills.map((skill, index) => (
                    <div
                        key={`${skill.name}-${index}`}
                        className={`mx-4 flex w-max items-center gap-2 rounded-full border border-white/10 bg-[var(--button-bg-${theme})] bg-[] px-5 py-2 text-[15px] shadow-sm`}
                    >
                        {skill.icon}
                        <span>{skill.name}</span>
                    </div>
                ))}
            </div>
            {/* second: left to right */}
            <div
                className="flex w-max animate-[marquee-reverse_120s_linear_infinite] whitespace-nowrap hover:[animation-play-state:paused]"
            >
                {duplicatedSkills.map((skill, index) => (
                    <div
                        key={`${skill.name}-${index}`}
                        className={`mx-4 flex w-max items-center gap-2 rounded-full border border-white/10 bg-[var(--button-bg-${theme})] bg-[] px-5 py-2 text-[15px] shadow-sm `}
                    >
                        {skill.icon}
                        <span>{skill.name}</span>
                    </div>
                ))}
            </div>
            {/* third: left to right */}
            <div
                className="flex w-max animate-[marquee_100s_linear_infinite] whitespace-nowrap hover:[animation-play-state:paused]"
            >
                {getEvenSkills.map((skill, index) => (
                    <div
                        key={`${skill.name}-${index}`}
                        className={`mx-4 flex w-max items-center gap-2 rounded-full border border-white/10 bg-[var(--button-bg-${theme})] bg-[] px-5 py-2 text-[15px] shadow-sm`}
                    >
                        {skill.icon}
                        <span>{skill.name}</span>
                    </div>
                ))}
            </div>

        </div>
    );
};

export default MarqueeSkills;
